WHYBECAUSE='''Q: Why do the palettes seem slightly different when used in the game?
A: The differences are tiny, but yes, they do exist. The main reason is that Dark Forces uses 6-bit color channel resolution (18-bit for the full RGB), instead of the 8/24 standard used by most hardware today. Certain colors will necessarily round down by a fraction - and thus change. The difference is minimal, it can never be larger than 3/256 (approximately 1.2 percent of the full range), but yes - it is there.
Another reason may be: perhaps you have edited the palette while having screen night mode enabled, and played while disabled? Or vice versa?

Q: I'd like to do some inter-palette and inter-map retailoring and copies and mixes, but since there's no straightforward copying and pasting, what can I do?
A: True - range selections, range copying and pasting across multiple tabs or program instances would have made it a never-ending project. (Perhaps in the v2.0.) However, you *can* perform these operations, by saving the work palettes and colormaps and then using "Palette>Merge with" and "Map>Replace with" options cleverly. It's only a bit more cumbersome, and you can undo anyway.

Q: Why can I never find color map auto-calculation settings that yield the original DF ones?
A: Mostly because they probably cannot exist in the first place. There are several hints pointing to the original color maps having been created through some kind of a semi-manual process with many custom adjustments and fine changes. These maps are very non-linear in order to, one would conjecture, help the players at low light levels. Also, some map segments are certainly not a result of calculation, but rather an attempt to improvise without all necessary colors. (E.g. Secret Base, range 192-207.)

Q: Isn't the GUI a bit cruder than it used to be in ChromaForces 1?
A: This all arises from the GUI framework chosen for this project. It is obviously not the most sophisticated one ever, but it does the job, it was simple enough to use, and fast enough to develop with - both of which are important points if you're making a living doing something else than writing game palette editors. Or, put it this way: going for a super-advanced GUI solution would likely sentence the project to being just another case of an overambitious goal, that would never get finished.'''


