AUTOHOMOGENIZEHINTS='''The purpose of this feature is to try sacrificing some colors in the palette, which are either unused or are not critically important, for the sake of avoiding abrupt changes in some areas of the color map. E.g. you've found a hue of violet you are happy with, but you're unhappy about it suddenly turning into grey at some light.

First, specify the area (the color region) of the color map which you are unhappy with. Typically it will be a range containing similar colors. Applying it over the entire map makes no sense.

Then, enter the list of colors in the palette, comma-separated, which you are ready to sacrifice in order to make the specified color region more homogenous. The button automatically finds the colors that are not in use.

The theoretical ideal transitions from the zero-light to full-brightness (0-31) will be calculated for all the colors in the given range, and the worst "offenders" in the current map found. These will be replaced with the corresponding ideal color, and the process repeated as long as there are colors to use.

Note that using many colors on a wide range may take a while, so don't be alarmed if it takes half a minute or so.'''


AUTOMAPHINTS='''Map auto-calculation is possibly among the more complex features of this application, so here's a quick intro to get you started.

In the top two rows, specify the area in the color map which will be affected - the colors and the MAP brightness levels.

Below, the projected light range specifies what PROJECTED color range will be used within the area already defined above. E.g. whether you want the colors to be simulated through a full range of all lightnesses (0-31) within THAT area, or only partially, etc. This may be useful if you want to e.g. introduce two lighting ranges within one colormap, e.g. one with natural colors, and other with a special shade (water, gas, etc.)

The color light transition method specifies what will be the colors used in the actual process. For most "usual" needs just go with the first one, which is similar to what vanilla Dark Forces does. However, if you want to create a haze effect (Gromas Mines), take the second option (make sure to select the desired haze color in the palette beforehand!). Or, the third option is useful if you want to shade the entire palette in a given tint/mask, again defined by the currently selected color.

There are also several ways the algorithm can look for the palette colors nearest to the theoretically calculated ideal one. The first, RGB matching is a standard approach, but fails in some specific cases where grey and blue clash (observe the default SECBASE palette). HSB actually compares hue, saturation and brightness values, and tries to balance the differences among these parameters, rather than via RGB. Furthermore, you can choose the hue to be a priority when picking, or saturation somewhat ignored. These options are there because they may yield maps a bit closer to the original ones, and perhaps more useful if you're aiming at some specific effects. E.g. retaining high saturation at low lights may make the game easier to play, but slightly unrealistic. Original Dark Forces palettes tend to slight desaturation as they darken, which is to an extent a reflection of what eyes do too.

Reversing the order of the color candidates being considered may be useful if you have got multiple duplicate colors, yet you would like those of the higher index number to be preferred over the lower ones.

Hint: If you would like to quickly create a palette whose zero-level light produces a red alert light effect (a la Condition Red), do the following: configure the color map light range from 0 to 0, the projected light range from 31 to 31, and select the 'Use selected color as a color limiter', of course after you've selected the red, or the other desired color, previously in the editor.
'''


